<div class="box-body">
    <ol style="text-align:justify;">
        <li>Search Sinkronisasi Data CSI berdasarkan “Nama Pembuat Report”, jadi pengguna dapat input Nama Pembuat Report kemudian Enter, maka akan menampilkan spesifik Nama Pembuat Report.<br>(Note : “Nama Pembuat Report” ini diambil dari nama Creator pada bagian menu Report Download di TMS Veristore)</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Sinkronisasi Data CSI berdasarkan “Tanggal Pembuatan Report”, maka akan menampilkan spesifik Tanggal Pembuatan Report yang dicari.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Sinkronisasi Data CSI berdasarkan “Status”, disini pengguna dapat melihat Status sinkronisasi, dan pada bagian Status ini memiliki beberapa informasi yaitu :
            <ul style="text-align:justify;">
                <li>Menunggu : Artinya file report excel data CSI sudah masuk ke dalam list Veristore Tools, tapi belum melakukan download file report excel data CSI</li>
                <li>Download : Sedang melakukan download file excel report data CSI dari TMS Veristore</li>
                <li>Proses : Sedang melakukan pengolahan terhadap file excel data CSI untuk di insert di database Veristore Tools</li>
                <li>Selesai : Berhasil melakukan sinkronisasi data CSI</li>
                <li>Gagal : Tidak berhasil melakukan sinkronisasi data CSI, karena download file excel report data CSI tidak berhasil.</li>
            </ul>
        </li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Sinkronisasi Data CSI berdasarkan “Disinkronisasi Oleh”, jadi pengguna dapat input nama user yang melakukan sinkronisasi atau pencarian secara penjadwalan dan kemudian Enter, maka akan menampilkan spesifik nama user atau penjadwalan pada kolom Disinkronisasi Oleh.<br>(Note : “Disinkronisasi Oleh” diambil dari nama user yang melakukan sinkronisasi Manual pada Veristore Tools, tapi jika sinkronisasi dilakukan secara penjadwalan maka pencarian pada “Disinkronisasi Oleh” ini dicari berdasarkan penjadwalan).</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Sinkronisasi Data CSI berdasarkan “Disinkronisasi Tanggal”, maka akan menampilkan spesifik Disinkronisasi Tanggal yang dicari.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
        <li>Search Sinkronisasi Data CSI berdasarkan “Nama Pembuat Report, Tanggal Pembuatan Report, Status, Disinkronisasi Oleh & Disinkronisasi Tanggal”.</li>
        <p><img alt="" src="data:image/png;base64,"/></p>
    </ol>
</div>
